  const [data, setData] = useState({})
  const navigate = useNavigate();

  useEffect(()=>{
    getData()
  },[])

  async function getData(){
    fetch(`${global.API_KEY}/films`)
      .then(res => res.json())
      .then((json) => console.log("respnse", json))
      .catch((error) => console.log(error));
  }


  return (
    <div>
      <h1>Homepage</h1>
      <button title="go" onClick={()=> navigate('/details')}/>
    </div>
  )
}
